      { Component } from 'react';
import { Link } from 'react-router-dom';

class TitleAndTextHorizontal extends Component {

  constructor( props )
  {

    supert(props);

  }

  render() {

    var { title, description, avatar } = this.props;

    return (
      <div>

        <div data-description-text="big-title-50" className="container-page hidden">
          <p data-title>{ title }</p>
          <p data-text>
            "Porque criamos a Oliveira Capital Lorem ipsum dolor sit amet, consectetur adipisicing elit. Qui ea consequuntur, odit veniam mollitia aliquam reiciendis dignissimos, vitae sapiente neque, cum dolorum. Suscipit expedita obcaecati nesciunt error ut quidem autem"

            <div data-avatar>
              <i></i>
              Felipe Oliveira
            </div>

          </p>
        </div>

        <div>
          <p>Nossos Pilares</p>
        </div>

      </div>
    );
  }
}
export default TitleAndTextHorizontal;
